import { useEffect, useState } from "react";
import adminService from "../Services/admin.services";
import { useNavigate } from "react-router-dom";
import toast, { Toaster } from 'react-hot-toast';

function LoginForm() {

	const [username, setUsername] = useState('');
	const [password, setPassword] = useState('');
	useEffect(() => {
		localStorage.clear()
	})
	const navigate = useNavigate();
	const loginUser = (e) => {
		e.preventDefault();

		var email = username;

		const user = { email, password }
		console.log(user)
		adminService.login(user)
			.then(respose => {
				console.log("User Login Credentials Send", respose.data)

				if (respose.data.length === 0) {
					toast.error('Invalid Credentials',
						{
							style: {
								borderRadius: '10px',
								background: '#333',
								color: '#fff',
							},
						}
					)
				}

				localStorage.setItem("user-token", JSON.stringify(respose.data))

				var data = JSON.parse(localStorage.getItem("user-token"));
				if (data.isadmin === true) {
					console.log("admin");
					navigate('/admin')
				} else if (data.isadmin === false) {
					console.log("user");
					navigate('/user')
				}
			})
			.catch(error => {
				console.log('Something Went Wrong', error);
			})
	}
	return (

		<div>
			<Toaster
				position="top-center"
				reverseOrder={false}
				toastOptions={{
					duration: 2200,
				}}
			/>
			<div className="container h-100">
				<div className="row justify-content-sm-center h-100">
					<div className="col-xxl-4 col-xl-5 col-lg-5 col-md-7 col-sm-9">
						<div className="text-center my-5">
							<img src="https://yt3.ggpht.com/a/AATXAJzW_hSMk1pFOfusLMZWv7poFmYLTNRhUBDnmw=s900-c-k-c0xffffffff-no-rj-mo" alt="logo" width="150" style={{ borderRadius: '50px' }} />
						</div>
						<div className="card shadow-lg">
							<div className="card-body p-5">
								<h1 className="fs-4 card-title fw-bold mb-4">Login</h1>
								<form onSubmit={(e) => loginUser(e)}>

									<div className="mb-3">
										<label className="mb-2 text-muted" htmlFor="email">E-Mail Address</label>
										<input id="email" type="email" className="form-control" name="email" required autoFocus
											value={username}
											onChange={(e) => setUsername(e.target.value)}
										/>
									</div>

									<div className="mb-3">
										<div className="mb-2 w-100">
											<label className="text-muted" htmlFor="password">Password</label>
										</div>
										<input id="password" type="password" className="form-control" name="password" required
											value={password}
											onChange={(e) => setPassword(e.target.value)}
										/>
									</div>

									<div className="d-flex align-items-center">
										<button type="submit" className="btn btn-primary">
											Login
										</button>
									</div>
								</form>
							</div>
							<div className="card-footer py-1 border-0">
								<div className="text-center mb-4">
									Don't have an account? <a href="/register" className="text-dark">Create One</a>
								</div>
							</div>
						</div>
						<div className="text-center mt-5 text-muted">
							Copyright &copy; 2023 &mdash; BookTown
						</div>
					</div>
				</div>
			</div>
		</div>
	);
}

export default LoginForm;
